(36,	1,	'member.update',	2,	'2.2',	'Member  <a href=\'http://portal.nfbpc.org/member/view/id/MTA2MQ==\' class=\'blockanchor\'>Bishop Joshua Lwere</a> updated',	'2014-11-26 23:14:30',	'Y',	'Safari, 8.0, Mozilla/5.0 (Macintosh; Intel Mac OS ',	'Safari',	'8.0',	'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_1) AppleWebKit/600.1.25 (KHTML, like Gecko) Version/8.0 Safari/600.1.25',	'Apple',	'0',	'216.246.166.229',	'http://portal.nfbpc.org/member/view/id/MTA2MQ==',	1,	'{\"id\":\"1061\",\"createdby\":\"279\",\"lastupdatedby\":\"1\",\"type\":\"7\",\"firstname\":\"Joshua\",\"lastname\":\"Lwere\",\"othername\":\"\",\"displayname\":\"Joshua Lwere\",\"nickname\":null,\"salutation\":\"9\",\"country\":\"UG\",\"nationality\":null,\"regionid\":\"2\",\"provinceid\":\"34\",\"districtid\":\"67709\",\"countyid\":\"154\",\"subcountyid\":\"540\",\"parishid\":\"3649\",\"villageid\":\"25132\",\"address1\":\"Apollo Kaggwa Road, opp.Shell Petrol Station\",\"address2\":null,\"postalcode\":null,\"gpslat\":\"\",\"gpslng\":\"\",\"email\":\"jlwere@gmail.com\",\"email2\":\"\",\"phone\":\"256772414390\",\"phone2\":\"\",\"phone_isactivated\":\"0\",\"phone_actkey\":null,\"username\":null,\"password\":\"\",\"trx\":null,\"status\":\"0\",\"activationkey\":\"e3c76f\",\"activationdate\":null,\"agreedtoterms\":\"0\",\"securityquestion\":null,\"securityanswer\":null,\"isinvited\":null,\"invitedbyid\":\"279\",\"hasacceptedinvite\":0,\"dateinvited\":\"2014-10-07\",\"organisationid\":\"137\",\"bio\":\"Bishop Joshua Lwere is the General Overseer of the National Fellowship of Born again Pentecostal Churches of Uganda (NFBPC). He is the \\r\\nDirector of Grace Christian Center Charitable Trust and Director Grace Community Support Program. He is also the Founder and Senior Pastor of Grace Assembly. Bp. Joshua is also a local Council Chief of his village.\\r\\n\\r\\nBp. Joshua is very passionate about National Transformation and particularly operates in the areas of Business, Civil Society, Conflict Resolution, Development, Internally Displaced, Humanitarian Relief, Social Entrepreneurship. He is married to Margaret Lwere and God has blessed them with four children, including twins.\\r\\n\\r\\nNATIONAL FELLOWSHIP INVOLVEMENT\\r\\n\\r\\nHave been part of this Fellowship since the day of its inception.\\u2028Witnessed the establishment of this Fellowship on 19th February 1990 in Timothy Class, at Watoto Church (then KPC) by the Late Hon Balak Kirya.\\r\\n\\r\\nClerk of NFBPC for 1998 - 2007\\r\\nLegal Advisor for the Fellowship\\r\\nDrafted the Constitution of the Fellowship\\r\\nDrafted and Set up the Structure of the Fellowship \\r\\nRegistered the Fellowship with Ministry of Internal Affairs\\r\\nDrafted the Code of Conduct with input from Dr. Mitala & Pr Michael Kyazze \\r\\n\\r\\nSet up the Fellowship Secretariat\\r\\nAdministration & Filing System\\r\\nMembership Registration system \\r\\nI set up the Fellowship Data base of member Churches country wide.\\r\\nMade the Fellowship Diary\\r\\n\\r\\nTravelled country-wide \\r\\nTeaching & explaining what this Fellowship is\\r\\nRecruiting pastors to join this Fellowship\\r\\nEstablishing Fellowship structures\\r\\nWith Dr. Mitala distributing wheel Chairs & meeting district\\/civic leaders\\r\\nWorking with Dr. Mitala, I have been involved in the identification, appointment, induction & orientation of the current members of the Elders Council.\\r\\n\\r\\nSpecial Services to the Pastors\\r\\nTraining Pastors in Church Leadership\\r\\nTraining Pastors in Finance & Church Administration.\\r\\nHave written books on leadership, finance & administration to help pastors spiritually and practically.\\r\\nHelping pastors to register their Churches in NGO & CBO\\u2019s\\r\\nProvided a Lawyer at my Church Premises to offer subsidised legal services to the Fellowship member pastors\\r\\n\\r\\nGeneral Secretary of the Fellowship (2007 - 2013)\\r\\n\\r\\n\",\"gender\":\"1\",\"dateofbirth\":null,\"profilephoto\":\"1417031436.jpg\",\"maritalstatus\":\"1\",\"website\":\"\",\"contactid\":null,\"contactname\":null,\"contactphone\":\"\",\"contactrshp\":\"\",\"noofchildren\":null,\"profession\":\"9\",\"specialisation\":null,\"datecreated\":\"2014-10-07 13:53:11\",\"lastupdatedate\":\"2014-11-26 22:55:20\"}',	'{\"id\":\"1061\",\"createdby\":\"279\",\"lastupdatedby\":\"1\",\"type\":\"7\",\"firstname\":\"Bishop Joshua\",\"lastname\":\"Lwere\",\"othername\":\"\",\"displayname\":\"Bishop Joshua Lwere\",\"nickname\":null,\"salutation\":\"10\",\"country\":\"UG\",\"nationality\":null,\"regionid\":\"2\",\"provinceid\":\"34\",\"districtid\":\"67709\",\"countyid\":\"154\",\"subcountyid\":\"540\",\"parishid\":\"3649\",\"villageid\":\"25132\",\"address1\":\"Apollo Kaggwa Road, opp.Shell Petrol Station\",\"address2\":null,\"postalcode\":null,\"gpslat\":\"\",\"gpslng\":\"\",\"email\":\"jlwere@gmail.com\",\"email2\":\"jlwere@me.com\",\"phone\":\"256772414390\",\"phone2\":\"256712414390\",\"phone_isactivated\":\"0\",\"phone_actkey\":null,\"username\":null,\"password\":\"\",\"trx\":null,\"status\":\"0\",\"activationkey\":\"e3c76f\",\"activationdate\":null,\"agreedtoterms\":\"0\",\"securityquestion\":null,\"securityanswer\":null,\"isinvited\":null,\"invitedbyid\":\"279\",\"hasacceptedinvite\":0,\"dateinvited\":\"2014-10-07\",\"organisationid\":\"137\",\"bio\":\"Bishop Joshua Lwere is the General Overseer of the National Fellowship of Born again Pentecostal Churches of Uganda (NFBPC). He is the \\r\\nDirector of Grace Christian Center Charitable Trust and Director Grace Community Support Program. He is also the Founder and Senior Pastor of Grace Assembly. Bp. Joshua is also a local Council Chief of his village.\\r\\n\\r\\nBp. Joshua is very passionate about National Transformation and particularly operates in the areas of Business, Civil Society, Conflict Resolution, Development, Internally Displaced, Humanitarian Relief, Social Entrepreneurship. He is married to Margaret Lwere and God has blessed them with four children, including twins.\\r\\n\\r\\nNATIONAL FELLOWSHIP INVOLVEMENT\\r\\n\\r\\nHave been part of this Fellowship since the day of its inception.\\u2028Witnessed the establishment of this Fellowship on 19th February 1990 in Timothy Class, at Watoto Church (then KPC) by the Late Hon Balak Kirya.\\r\\n\\r\\nClerk of NFBPC for 1998 - 2007\\r\\nLegal Advisor for the Fellowship\\r\\nDrafted the Constitution of the Fellowship\\r\\nDrafted and Set up the Structure of the Fellowship \\r\\nRegistered the Fellowship with Ministry of Internal Affairs\\r\\nDrafted the Code of Conduct with input from Dr. Mitala & Pr Michael Kyazze \\r\\n\\r\\nSet up the Fellowship Secretariat\\r\\nAdministration & Filing System\\r\\nMembership Registration system \\r\\nI set up the Fellowship Data base of member Churches country wide.\\r\\nMade the Fellowship Diary\\r\\n\\r\\nTravelled country-wide \\r\\nTeaching & explaining what this Fellowship is\\r\\nRecruiting pastors to join this Fellowship\\r\\nEstablishing Fellowship structures\\r\\nWith Dr. Mitala distributing wheel Chairs & meeting district\\/civic leaders\\r\\nWorking with Dr. Mitala, I have been involved in the identification, appointment, induction & orientation of the current members of the Elders Council.\\r\\n\\r\\nSpecial Services to the Pastors\\r\\nTraining Pastors in Church Leadership\\r\\nTraining Pastors in Finance & Church Administration.\\r\\nHave written books on leadership, finance & administration to help pastors spiritually and practically.\\r\\nHelping pastors to register their Churches in NGO & CBO\\u2019s\\r\\nProvided a Lawyer at my Church Premises to offer subsidised legal services to the Fellowship member pastors\\r\\n\\r\\nGeneral Secretary of the Fellowship (2007 - 2013)\\r\\n\\r\\n\",\"gender\":\"1\",\"dateofbirth\":null,\"profilephoto\":\"1417031436.jpg\",\"maritalstatus\":\"1\",\"website\":\"\",\"contactid\":null,\"contactname\":null,\"contactphone\":\"\",\"contactrshp\":\"11\",\"noofchildren\":null,\"profession\":\"9\",\"specialisation\":null,\"datecreated\":\"2014-10-07 13:53:11\",\"lastupdatedate\":\"2014-11-26 23:14:30\"}',	'{\"firstname\":\"Joshua\",\"displayname\":\"Joshua Lwere\",\"lastupdatedate\":\"2014-11-26 22:55:20\"}'),
