has blessed them with four children, including twins.\\r\\n\\r\\nNATIONAL FELLOWSHIP INVOLVEMENT\\r\\n\\r\\nHave been part of this Fellowship since the day of its inception.\\u2028Witnessed the establishment of this Fellowship on 19th February 1990 in Timothy Class, at Watoto Church (then KPC) by the Late Hon Balak Kirya.\\r\\n\\r\\nClerk of NFBPC for 1998 - 2007\\r\\nLegal Advisor for the Fellowship\\r\\nDrafted the Constitution of the Fellowship\\r\\nDrafted and Set up the Structure of the Fellowship \\r\\nRegistered the Fellowship with Ministry of Internal Affairs\\r\\nDrafted the Code of Conduct with input from Dr. Mitala & Pr Michael Kyazze \\r\\n\\r\\nSet up the Fellowship Secretariat\\r\\nAdministration & Filing System\\r\\nMembership Registration system \\r\\nI set up the Fellowship Data base of member Churches country wide.\\r\\nMade the Fellowship Diary\\r\\n\\r\\nTravelled country-wide \\r\\nTeaching & explaining what this Fellowship is\\r\\nRecruiting pastors to join this Fellowship\\r\\nEstablishing Fellowship structures\\r\\nWith Dr. Mitala distributing wheel Chairs & meeting district\\/civic leaders\\r\\nWorking with Dr. Mitala, I have been involved in the identification, appointment, induction & orientation of the current members of the Elders Council.\\r\\n\\r\\nSpecial Services to the Pastors\\r\\nTraining Pastors in Church Leadership\\r\\nTraining Pastors in Finance & Church Administration.\\r\\nHave written books on leadership, finance & administration to help pastors spiritually and practically.\\r\\nHelping pastors to register their Churches in NGO & CBO\\u2019s\\r\\nProvided a Lawyer at my Church Premises to offer subsidised legal services to the Fellowship member pastors\\r\\n\\r\\nGeneral Secretary of the Fellowship (2007 - 2013)\\r\\n\\r\\n\",\"gender\":\"1\",\"dateofbirth\":null,\"profilephoto\":\"1417031436.jpg\",\"maritalstatus\":\"1\",\"website\":\"\",\"contactid\":null,\"contactname\":\"Mrs Christine Margaret Lwere\",\"contactphone\":\