INSERT INTO `committee` (`id`, `code`, `name`, `description`, `abbr`, `datecreated`, `createdby`, `lastupdatedate`, `lastupdatedby`, `isfeatured`, `sortorder`, `defaultemail`) VALUES
(1,	'CM01',	'National Executive Committee',	'The National Delegates Conference (NDC) is the highest decision making body of the fellowship.  The NDC constitutes an electoral college which elects the highest executive organ of the fellowship, the National Executive Committee (NEC). NFBPC has executive committees serving at Regional, Provincial, District and Sub-county levels that is, REC, PEC, DEC and SEC respectively. These are elected to serve a term of five years as stipulated in the NFBPC constitution. In addition, the GO is supported by a council of 24 elders appointed for life and including any outgoing (retired) General Overseers, a Doctrinal & Restoration Committee (DRC) that handles doctrine & discipline, an Electoral Commission (EC) that handles national and local elections, a Constitutional Review Commission (CRC) handles Constitutional matters and a National Fellowship Tribunal (NFT) that handles disputes (Civil, Ministerial & Ethical).',	'NEC',	'2014-09-15 12:00:00',	1,	'2014-11-03 16:05:09',	279,	1,	1,	NULL),
(2,	'CM02',	'Electoral Commission',	NULL,	'FEC',	'2014-09-15 12:00:00',	1,	NULL,	NULL,	NULL,	8,	NULL),
(3,	'CM03',	'Council of Elders',	'A committee of exemplary Spiritually mature ministers who take custody of the Ethics and Integrity of the  Leaders of NFBPC and uphold the Sovereignty of the Fellowship.  the CoE consists of 25 elders at the National Level and is also represented on every grass root level, by similar natured ministers selected by their levels in consultation with the National Elders\' Board (CoE).',	'COE',	'2014-09-15 12:00:00',	1,	'2015-01-03 18:09:52',	1070,	1,	3,	NULL),
