(279,	1,	'Robert',	'Mutyaba',	'',	'Robert Mutyaba',	NULL,	'13',	'rbm@rbmafrica.com',	'',	'256712466456',	'',	NULL,	NULL,	'rmutyaba',	'ba8aa25283e44e9eb5f17c7d3513fa006635740a',	'1',	NULL,	'2014-10-07 13:49:10',	'',	1,	NULL,	NULL,	'2014-10-01 12:00:00',	1,	'2014-11-03 16:18:50',	279,	NULL,	'UG',	2,	34,	16,	154,	540,	3630,	25001,	NULL,	'',	NULL,	'',	'',	NULL,	0,	'2014-10-07',	1,	1,	NULL,	NULL,	'Robert B. Mutyaba is the Minister for ICT. He provides leadership to the NFBPC Ministry of ICT; and strengthens our projects with his exceptional abilities and experience in needs analysis, project management, quality control, design and specification, modification of standard software, development of supplementary applications, installation and implementation, education, support, and maintenance. Robert is a strategic thinker and a member of Institute for National Transformation Alumni.\r\n\r\nMorever, Robert has passion for ministry: he has spent over 10 years as a youth mentor, leading the discipleship department at the Redeemed of the Lord Evangelistic Church. He is passionate about national transformation, and especially the Biblical approach to transforming lives. He reads widely and gives himself fully for the work of Christ!\r\n\r\nRobert has worked as an implementer of financial systems since 1999 and been involved in over 40% of the Microsoft Dynamics NAV implementations in Uganda, and several in East Africa and at least 10% of the Enterprise Intuit QuickBooks Implementations. Robert provides management to RBM Systems Consult Ltd, the company authorised to sell Intuit QuickBooks products in Uganda.\r\n\r\nRobert holds a Master of Science in Computer Science, a Bachelors degree in Science (Mathematics), a post graduate diploma in Computer Science, and ACCA I certificate from ACCA Global (UK). He is also a Certified Navision Product Specialist, Certified Navision Solutions Developer, and holds Intuit QuickBooks certifications in Point of Sale and Enterprise Solutions.\r\n\r\nRobert has also attained high level Oakseed Leadership Training with the Institute for National Transformation in Uganda, and sits on the board of directors for Child and Family Foundation Uganda, Labourers Terms of Covenant and serves on leadership teams at The Redeemed of the Lord Evangelistic Church Makerere. He also leads the Discipleship department there.',	1,	NULL,	'1415002218.jpg',	1,	'',	NULL,	NULL,	NULL,	'',	NULL,	'3',	NULL),
