(1061,	7,	'Bishop Joshua',	'Lwere',	'',	'Bishop Joshua Lwere',	NULL,	'10',	'jlwere@gmail.com',	'jlwere@me.com',	'256772414390',	'256712414390',	NULL,	0,	NULL,	'',	'0',	NULL,	NULL,	'e3c76f',	0,	NULL,	NULL,	'2014-10-07 13:53:11',	279,	'2014-11-26 23:16:31',	1,	NULL,	'UG',	2,	34,	67709,	154,	540,	3630,	25009,	NULL,	'Apollo Kaggwa Road, opp.Shell Petrol Station',	NULL,	'',	'',	NULL,	0,	'2014-10-07',	279,	137,	NULL,	NULL,	'Bishop Joshua Lwere is the General Overseer of the National Fellowship of Born again Pentecostal Churches of Uganda (NFBPC). He is the \r\nDirector of Grace Christian Center Charitable Trust and Director Grace Community Support Program. He is also the Founder and Senior Pastor of Grace Assembly. Bp. Joshua is also a local Council Chief of his village.\r\n\r\nBp. Joshua is very passionate about National Transformation and particularly operates in the areas of Business, Civil Society, Conflict Resolution, Development, Internally Displaced, Humanitarian Relief, Social Entrepreneurship. He is married to Margaret Lwere and God has blessed them with four children, including twins.\r\n\r\nNATIONAL FELLOWSHIP INVOLVEMENT\r\n\r\nHave been part of this Fellowship since the day of its inception. INSERT INTO `message` (`id`, `senderid`, `parentid`, `subject`, `contents`, `html`, `datecreated`, `type`, `sendername`, `senderemail`, `membertotal`, `usertotal`, `smsid`, `resultcode`, `status`) VALUES
