(11,	NULL,	NULL,	'we would like to join with you',	' Dear Friend\r\nGreetings to you from ENHAKKORE ,established  IN 200 just a hope, but a realistic expectation for all. While we have made significant progress toward achieving this goal, there is much remaining to be done.\r\nWe are blessed with a platform that affords us the opportunity to give a voice to those who don’t have a voice, to help people become more passionate and fulfilled in their   LIFE, relationships, spiritual life and career.\r\n\r\nKailay Raju,my wife LEELA  are committed to improving the lives of disadvantaged and ORPHAN  children. In collaboration with others, we strive to provide youths with access to critically needed services, including safe and decent housing, medical and mental health services, education and job training. In a secure and loving environment, it is our belief these children will develop a new sense of responsibility and commitment to themselves, their fellow human beings, their communities and nation.\r\n\r\nBy joining together, we will be able to bring together all of our combined talents and blessings to help people develop a sense of purpose and mission in their lives. We earnestly seek your support of this effort to help create a defining moment in the lives of children and families.\r\n\r\n \r\n\r\nSincerely\r\n\r\nKailay Raju\r\n\r\n//www.facebook.com/apostlechurchinindia\r\n\r\nwww.faithindeed.com\r\n \r\nwww.facebook.com/pages/Children-for-GOD/140703405972910\r\n\r\nKailay Raju\r\nH No#9\r\nAYODHYA NAGAR COLONY\r\nLOTHKUNTA, SECUNDERABAD - 5000 15\r\nANDHRA PRADESH, INDIA\r\nCELL NO - 0091-9618559965\r\nEmail ID - rajukailay@gmail.com \r\nWebsite - www. faithindeed.com \r\n \r\nhttp://www.youtube.com/user/kailay37\r\n',	NULL,	'2014-12-03 08:17:10',	1,	'Kailay Raju',	'rajukailay@gmail.com',	'1',	'1',	NULL,	NULL,	NULL),
