(16,	1070,	NULL,	'THE MINISTERS\' MEETING',	'Dear Servants of the Lord, \r\n\r\nI hereby invite you to tomorrow\'s 3rd NPBPC Minister\'s Meeting due to take place at the NFBPC offices; tomorrow 10-12-2014, from 5:00 p.m.\r\n\r\nThe Agenda includes; Developing a system of Mobilizing the Churches within Greater Kampala Region.\r\n\r\nPlease endeavor to attend\r\n\r\nAfricano Magyezi\r\nNational Clerk',	NULL,	'2014-12-09 19:24:06',	1,	NULL,	NULL,	'5',	'5',	NULL,	NULL,	NULL),
